import React from "react";
import {
  Grid,
  Container,
  Typography,
  CardActionArea,
  Card,
  CardMedia,
  CardContent,
} from "@material-ui/core";
import r1 from "./SyImg/ref/adoreLogo.png";
import r2 from "./SyImg/ref/bellonma.jpeg";
import r3 from "./SyImg/ref/istikballogo.png";
import r4 from "./SyImg/ref/kelebek.png";
import r5 from "./SyImg/ref/yatas_grup_logo.jpg";
import { CardHeader } from "@material-ui/core";

const Referances = () => {
  return (
    <div>
      <div className="ref"></div>
      <Grid container direction="row" spacing={5}>
        <Grid item xs={12} md={6} lg={4}>
          <Card>
            <CardActionArea>
              <CardHeader title="deneme1" />
              <CardMedia component="img" image={r1} height="200" />
              <CardContent>
                <Typography
                  variant="body2"
                  color="textSecondary"
                  component="p"
                ></Typography>
              </CardContent>
            </CardActionArea>
          </Card>
        </Grid>
        <Grid item xs={12} md={6} lg={4}>
          asdasd
        </Grid>
        <Grid item xs={12} md={6} lg={4}>
          asdasd
        </Grid>
        <Grid item xs={12} md={6} lg={4}>
          asdasd
        </Grid>
      </Grid>
    </div>
  );
};

export default Referances;
